import "./product.css";

const Product = () => {
  let price = Math.ceil(Math.random * Math.random);
  return (
    <div className="product">
      <img src="https://picsum.photos/300/200" alt="Product" />
      <p>Own this for only {price}</p>
    </div>
  );
};

export default Product;
